description:
Those Housewives have been naughty... very naughty. But they rarely get what's coming to them... until now! Housewives at Play: Hanky Spanky features another heaping helping of gorgeous Rebecca art, this time depicting the Housewives in all sorts of painfully compromising positions as punishment is meted out... in spades! Face it, if you're going to be a pain in the ass, it's only a time before karma catches up with you... in the end!


And for those of you that don't know CBR and CBZ files, CBR is renamed .rar files and CBZ are renamed .zip files, and they are the normal way to share comic scans. You can either download free CBR readers (just google it, I recommend GonVisor myself) or unpack them and read them in your favorite image reader.
